import React from "react";
import { useSelector } from "react-redux";
import { SHOW_ALL } from "../../constants";
import { SHOW_ACTIVE } from "../../constants";
import { SHOW_COMPLETED } from "../../constants";
interface Props {
  title: string;
}
const SubFilter = ({ title }: Props) => {
  const currentFilter = useSelector((store: any) => store.currentFilter);

  switch (currentFilter) {
    case SHOW_ACTIVE:
      return (
        <div className="subFilter active">
          <p>{title}</p>
        </div>
      );
    case SHOW_COMPLETED:
      return (
        <div className="subFilter active">
          <p>{title}</p>
        </div>
      );
    case SHOW_ALL:
      return (
        <div className="subFilter active">
          <p>{title}</p>
        </div>
      );
    default:
      return (
        <div className="subFilter">
          <p>{title}</p>
        </div>
      );
  }
  //   return (
  //     <div className="subFilter ">
  //       <p>{title}</p>
  //     </div>
  //   );
};
export default SubFilter;
